Back to Beruit

Travel Documentary hosted by Anthony Bourdain, published by Discovery Channel broadcasted as part of DC No Reservations series in 2010 - English narration


Information
------------------------------

Anthony Bourdain returns to Lebanon to film the show he was meant to do in 2006, when he was stuck in the middle of an intense conflict, causing him to cut the trip short.

